import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faMinusCircle, faMusic } from "@fortawesome/free-solid-svg-icons";

function Nav() {
  return;
  <nav>
    <h1>Waves</h1>
    <button>
      Library
      <FontAwesomeIcon icon={faMusic} />
    </button>
  </nav>;
}

export default Nav;
